  \"2013-06-12T18:01:22.292501\",\n\t\"name\": \"source-water-assessment-area-swa\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Source water assessment area (SWA) is the
  Minnesota Department of Health (MDH) interim surface and subsurface area surrounding
  a public water supply well that completely contains the scientifically calculated
  time-of-travel (TOT) area. The primary purpose of the SWA is to give the public
  water supplier an idea of the potential size of the final Wellhead Protection Area
  (WHPA). The TOT for a non-vulnerable SWA (Meth_code = FRC) is 3 years and for a
  vulnerable SWA (Meth_code = AM) is 10 years. Ultimately the SWA will be replaced
  by a WHPA and a corresponding Drinking Water Supply Management Area (DWSMA).\",\n\t\"license_title\":
